import React from 'react'

const UserInfo = () => {
  const get = async () => {
    const opts = {
      credentials: "include",
      method: "POST",
      headers: {
        Authorization: `Bearer ${localStorage.getItem('access_token')}`,
      },
      body: JSON.stringify(JSON.stringify({access_token: localStorage.getItem("access_token")}))
  }
    let res = await fetch('http://127.0.0.1:5000/@me', opts)
    return await res.json()
}
